import React from 'react';

const info = [
	info1 = {
		desc: "Here you can just enjoy a nice little walk in the woods and such.",
		image: process.env.PUBLIC_URL + "/assets/dark-forest.jpeg",
		direction: 'left',
	},
	info2 = {
		desc: "This is one path where you find forest houses and get killed brutally by mutant retards",
		image: process.env.PUBLIC_URL + "/assets/forest-houses.jpeg",
		direction: 'right',
	}
];

export default info;
